	(521, 'Higinor', 'Célia', '4008-5976', 'Fez uma nota de entrada com o fornecedor errado e a nota foi aprovada', 'Fornecedor errado - F.C OLIVEIRA & CIA LTDA\r\nFornecedor errado -  765 MARTINS COMERCIO SERVIÇO E DISTRIBUIÇÃO\r\n\r\nrotina 312 - status nota entrada', 'intervenção  nota   ', '1 - teve que habilitar ela no evento NFE_STATUS  \r\n2 - ir na rotina 321 para fazer a intervenção da nota\r\n3 - ir na entrada de nota procurar ela clicar com o botão direito e ir em trocar fornecedor que vai está habilitado.', '960703886', 'willtunner', '2020-01-22', '11:49:11', 'F', 'willtunner', '2020-01-22', '11:49:11', NULL, NULL, NULL),
	(522, 'Logicom', 'clauber', '991938298', 'Ligação para Orlando', 'OI fibras entrou em contato querendo agendar um horario para instalar', 'Ligação para Orlando    ', 'Orlando estava em reunião, foi solicitado para que retornasse o contato a partir da 10:30', '749473121', 'clauber', '2020-01-22', '11:59:02', 'F', 'clauber', '2020-01-22', '11:59:02', NULL, NULL, NULL),
	(523, 'Higinor', 'Lourdes', '1', 'duvidas ', 'Lurdes entrou emcontato solicitando acompanhamento para a emissão deumanota fiscal de devolução.\r\nestava em duvidas com tributação e cfop.', 'duvidas    ', 'Ela teve orientação de sua contadora,eu fiz o acompanhamento e a nota foi autorizada normalmente', '960703886', 'clauber', '2020-01-22', '12:13:16', 'F', 'clauber', '2020-01-22', '12:13:16', NULL, NULL, NULL),
	(524, 'Logicom', 'clauber', '991938298', 'Ligação para Orlando', 'OI fibras entrou em contato novamente querendo agendar um horario para instalar ', 'Ligação para Orlando    ', '\r\nOrlando estava em reunião, foi solicitado para que retornasse o contato a partir da 16:00', '749473121', 'clauber', '2020-01-22', '12:53:36', 'F', 'clauber', '2020-01-22', '12:53:36', NULL, NULL, NULL),
	(525, 'SoS Tamandaré', 'Durval', '(91)98116-4349', 'duvidas', 'O Sr Durval entrou em contato solicitando um suporte com relação aos ex usuarios cadastrados.\r\nEle estava querendo exclui-los. ', 'duvidas    ', 'Eu expliquei que não poderia,pois os mesmo ja teriam historicos, por isso nao daqui para eclui-los.', '751413595', 'clauber', '2020-01-22', '15:47:36', 'F', 'clauber', '2020-01-22', '15:47:36', NULL, NULL, NULL),
	(526, 'PB Farma CN', 'Gilvano', '(91)9 8959-9546', 'problema com checkout', 'O sr Gilvano entrou em contato solicitando suporte pra ver um problama que deu no checkout.\r\nSegundo ele, deu um pique de energia e o caixa havia parado de funcionar.', 'problema com checkout    netuser impressora', 'Ao conectar, percebi que teriam restaurado o checkout.\r\ntive que reinstalar o certificado, apenas.\nWilliam - não estava imprimindo e tive que criar um bat com o net user\nnet use lpt1: /delete\nnet use lpt1: \\\\127.0.0.1\\EPSON\n', '', 'clauber', '2020-01-22', '17:26:23', 'F', 'willtunner', '2020-01-22', '08:31:53', NULL, NULL, NULL),
	(527, 'Rofama', 'Brito', '(91)98088-9795', 'Instalação de caixa', 'o caixa que estava apresentou problemas e substituiram por um do balcão', 'instalação Caixa retaguarda   ', 'foi instalado o checkout_setup, exp_venda_ret, netframework 4.5 e o certificado e colocado na pasta logicom/nfce/certificado', '413957386', 'willtunner', '2020-01-22', '16:45:06', 'F', 'willtunner', '2020-01-22', '16:45:06', NULL, NULL, NULL),
